.drop-enter-active {
  animation: drop-in .3s;
}
.drop-leave-active {
  animation: drop-in .3s reverse;
}
@keyframes drop-in {
  0% {
    top: 35%;
    opacity: 0.7
  }
  100% {
    opacity: 1;
  }
}
.common-alert {
  .closeBtnClass {
    font-size: 14px
  }
  .alert-markAll {
    position: fixed;
    width: 100%;
    height: 100%;
    z-index: 100;
    top: 0;
    left: 0;
  }
  .alert-frame {
    transform: 0.3s transition;
    position fixed;
    z-index: 101;
    left: 50%;
    top: 50%;
    transform: translate3d(-50%, -50%, 0);
    width: 480px;
    padding: 60px 36px 67px 144px;
    box-sizing: border-box;
    border-radius: 2px;
    .alert-close {
      position: absolute;
      right: 20px;
      top: 10px;
      cursor: pointer
    }
    .alert-img {
      position: absolute;
      width: 80px;
      height: 80px;
      left: 39px;
      top: 55px;
    }
    .alert-main {
      display: inline-block;
      width: 300px;
      min-height: 60px;
      word-wrap: break-word;
      word-break: normal;
      font-size: 14px;
    }
    .alert-button {
      position: absolute;
      bottom: 20px;
      right: 25px;
    }
  }
}
